import React from 'react';
import { Button } from "react-bootstrap";
import { faComment } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
class DashMenu extends React.Component{
    render(){
        return(
            <div className="dashmenu-wrapper">
<Button variant="primary">Menu</Button>
<Button variant="primary"><FontAwesomeIcon icon={faComment} />Reviews()</Button>
<Button variant="primary">Restaurant Info</Button>

            </div>
        )
    }
}

export default DashMenu
